import React, { useState } from "react";
import birthdayData from "./data/basic_data";
import List from "./components/list";
import { Button, Grid, Box, Container, Typography, Paper } from "@mui/material";

function App() {
  const [people, setPeople] = useState(birthdayData);
  return (
    <Grid container alignItems="center" justifyContent="center" display="flex">
      <Grid item xs={12} justifyContent="center">
        <Box
          justifyContent="center"
          alignItems="center"
          maxHeight="90vh"
          maxWidth="40vw"
          bgcolor="white"
          borderRadius="10px"
          boxShadow="5px 5px 5px 5px #888888"
          margin={2}
        >
          <List people={people} />
          <Button
            sx={{ color: "pink", bgcolor: "#900C3F" }}
            variant="contained"
            onClick={() => setPeople([])}
          >
            Clear All
          </Button>
        </Box>
      </Grid>
    </Grid>
  );
}

export default App;
